/**----------------------------------------------------------------------------
 * sidebar
 *
 * @section plugins
*/

$(document).ready(function(e) {
    // function de expandir 1ยบ nivel de submenu
    $("#leftside-navigation .sub-menu > a").click(function(e) {
        $("#leftside-navigation ul ul").slideUp(), $(this).next().is(":visible") || $(this).next().slideDown(),
        e.stopPropagation()
    })

    // function de expandir 2ยบ nivel de submenu
    $("#leftside-navigation .sub-menu-3 > a").click(function(e) {
        $("#leftside-navigation ul ul ul").slideUp(), $(this).next().is(":visible") || $(this).next().slideDown(),
        e.stopPropagation()
    })

    // function para fechar btn submenu quando clicar fora da seta de fechamaneto
    $(document).mouseup(function(e) {
        var container = $("#leftside-navigation .sub-menu > a");
        var container = $("#leftside-navigation .sub-menu-3 > a");
        if (!container.is(e.target) && container.has(e.target).length === 0) {
            $("#leftside-navigation ul ul").slideUp();
            $("#leftside-navigation ul ul ul").slideUp();
        }
    });
});

//Nav current active
$(document).ready(function(e) {
   function setNavigation() {
        var path = "http://" + window.location.hostname + window.location.pathname;
        path = path.replace(/\/$/, "");
        path = decodeURIComponent(path);
    
        $("ul#demo-menu li a").each(function () {
            var href = this.href;
            if (path.trim() == href.trim()) {
                $(this).closest('a').addClass('current-active');
            }
        });
    }
    setNavigation();
});


/**----------------------------------------------------------------------------
 * toggleFullScreen
 *
 * @section plugins
*/

$(function() {

    "use strict";

    // Fullscreen
    function toggleFullScreen() {
        if ((document.fullScreenElement && document.fullScreenElement !== null) ||
            (!document.mozFullScreen && !document.webkitIsFullScreen)) {
            if (document.documentElement.requestFullScreen) {
                document.documentElement.requestFullScreen();
            } else if (document.documentElement.mozRequestFullScreen) {
                document.documentElement.mozRequestFullScreen();
            } else if (document.documentElement.webkitRequestFullScreen) {
                document.documentElement.webkitRequestFullScreen(Element.ALLOW_KEYBOARD_INPUT);
            }
        } else {
            if (document.cancelFullScreen) {
                document.cancelFullScreen();
            } else if (document.mozCancelFullScreen) {
                document.mozCancelFullScreen();
            } else if (document.webkitCancelFullScreen) {
                document.webkitCancelFullScreen();
            }
        }
    }

    $('.toggle-fullscreen').click(function() {
        toggleFullScreen();
    });
});


